/*Table structure for table `c_goods` */

DROP TABLE IF EXISTS `c_goods`;

CREATE TABLE `c_goods` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `goods_name` varchar(128) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_weight` int(11) NOT NULL DEFAULT '0' COMMENT '重量',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `goods_number` int(11) NOT NULL DEFAULT '100' COMMENT '数量',
  `goods_category_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类',
  `goods_brand_id` int(11) NOT NULL DEFAULT '0' COMMENT '品牌',
  `goods_introduce` text COLLATE utf8_unicode_ci COMMENT '详细介绍',
  `goods_big_img` varchar(128) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商品图片',
  `goods_small_img` varchar(128) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商品小图',
  `goods_create_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `goods_last_time` int(11) NOT NULL DEFAULT '0',
  `abc` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=67 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='商品表';

/*Data for the table `c_goods` */

insert  into `c_goods`(`goods_id`,`goods_name`,`goods_weight`,`goods_price`,`goods_number`,`goods_category_id`,`goods_brand_id`,`goods_introduce`,`goods_big_img`,`goods_small_img`,`goods_create_time`,`goods_last_time`,`abc`) values (10,'索爱C7069',0,'1500.00',7,3,7,'&lt;p&gt;C702可以说是一种在外观上复古的产物，不仅延续T系列早期的直板造型，而且在屏幕和键盘的组合分布上都继承了前辈的精髓。C702的机身尺寸为106×48×15.5毫米，重量为105克。此外索尼爱立信为C702融入了&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;&lt;strong&gt;三防特性，即防尘、防滑和防水溅&lt;/strong&gt;&lt;/font&gt;，这款新的C702搭载了索尼爱立信经典A200平台，界面布局与W908c、K858c一致，典型的特征就是配备左右软键、中央确定键和通话/挂机键。&lt;/p&gt;\r\n&lt;p&gt;索尼爱立信C702配备一块&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;2.2英寸26万色TFT液晶显示屏&lt;/font&gt;&lt;/strong&gt;，分辨率为240×320像素(QVGA)，显示效果属于目前主流水准。C702可以说是索尼爱立信首批&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;内置GPS模块&lt;/font&gt;&lt;/strong&gt;的 手机产品之一，C702的搜星、定位一气呵成，十分精准，误差大约在10米之内。基本上定位后可以将有效卫星数量控制在4—6颗，可以说可以满足我们的需 要了。C702还提供了“影像定位”功能，配合内置的AGPS全球定位辅助系统，只须启动Geo-Tagging智能影像定位功能，便可将拍摄地点记录在 照片内，方便用户随时查询。&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;作为一款Cyber-shot系列影像手机，索尼爱立信C702在拍照功能方面同样有不俗的表现。并且手机内置的&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;320万像素摄像头&lt;/font&gt;&lt;/strong&gt;也 同样在拍照功能上也不错的表现。不仅支持自动聚焦和双LED闪光功能，而且还拥有2倍数码变焦、防红眼、Photo fix优画及场景模式等功能。索尼爱立信C702除了配备的是最大光圈为F3.2的4.2毫米镜头之外，该机也如同门中的旗舰C902一样增加了对脸部有 先自动聚焦功能的支持。&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;','upload/images/200905/goods_img/10_G_1242973436141.jpg','upload/images/200905/thumb_img/10_thumb_G_1242973436403.jpg',1241965622,0,''),(11,'索爱C702cc',0,'1300.00',1,3,7,'','upload/images/200905/goods_img/12_G_1241965978209.jpg','upload/images/200905/thumb_img/10_thumb_G_1242973436403.jpg',1241966951,0,''),(12,'摩托罗拉A8100',0,'983.00',8,3,2,'&lt;p&gt;全机使用的材质除去电池盖部分采用了金属以外，其它均使用了ABS工程塑料作为主材，这款手机的三围是105×51×14毫米，有着100克的轻量级重量，拿在手中的感觉还是非常不错的。A810手机作为一款&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;PDA手机&lt;/font&gt;&lt;/strong&gt;在设计的时候取消了键盘配置，一切数字键都要依靠手机内提供的虚拟键盘进行操作，在手机的左上侧是一个&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;3.5mm的标准耳机插口&lt;/font&gt;&lt;/strong&gt;，这种设计可以让用户使用自己习惯或者喜欢的耳机去欣赏音乐。&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n&lt;p&gt;这款摩托罗拉A810手机配置了一块&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;&lt;strong&gt;26万色的2.2英寸TFT全触摸屏幕&lt;/strong&gt;&lt;/font&gt;，其分辨率达到了主流的QVGA水平（240×320像素），摩托罗拉A810采用了内部核心为2.6.10的&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;LINUX操作系统&lt;/font&gt;&lt;/strong&gt;，菜单上依然采用传统的9宫格的显示方式，一般手机的名片式电话本只能支持诸如电话、邮件、传真、公司等一些基本信息，而A810手机的电话本除了这些还支持公司地址，配偶信息、子女姓名、上司名称、助手等等，对于一款手机来说，电话本不可谓不强大。A810的&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;手写识别能力相当的惊人&lt;/font&gt;&lt;/strong&gt;，对连笔、草书和倒插笔的识别率都相当的高，同时还为左右手设置了不同的书写习惯选择，并支持手写速度的调节。&lt;/p&gt;\r\n&lt;p&gt;这款A810手机&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;内置的音乐播放功能&lt;/font&gt;&lt;/strong&gt;可以支持MP3、WAV、AMR、AAC等格式的音乐播放，&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;&lt;strong&gt;支持后台播放&lt;/strong&gt;&lt;/font&gt;。视频方面，这款A810支持MP4、3GP、H.263格式的播放，视频播放器同样简约，操作方便，这款摩托罗拉A810还内置了6款游戏，每一款都有很高的耐玩性，而且都是支持触摸屏操作的，同时这款手机还内置了&lt;strong&gt;&lt;font size=&quot;3&quot; color=&quot;#ff0000&quot;&gt;FM收音机&lt;/font&gt;&lt;/strong&gt;，支持自动搜索，并提供了20个频道供用户存储，不过收音机并不支持后台播放。&lt;/p&gt;\r\n&lt;p&gt; &lt;/p&gt;','upload/images/200905/goods_img/12_G_1241965978209.jpg','upload/images/200905/thumb_img/12_thumb_G_1241965978410.jpg',1245297652,0,''),(13,'诺基亚5320 XpressMusic',0,'1311.00',8,3,1,'<p>诺基亚5320XpressMusic音乐手机采用XpressMusic系列常见的黑红、黑蓝配色方案，而材质方便则选用的是经过<strong><font size=\"3\" color=\"#ff0000\">抛光处理</font></strong>的工程塑料；三围/体重为，为108&times;46&times;15mm/<strong><font size=\"3\" color=\"#ff0000\">90g</font></strong>，手感舒适。</p>\r\n<p>&nbsp;</p>\r\n<p>诺基亚5320采用的是一块可视面积为2.0英寸的<font size=\"3\" color=\"#ff0000\"><strong>1600万色</strong></font>屏幕，分辨率是常见的240&times;320像素（QVGA）。虽然屏幕不是特别大，但效果非常精细，色彩还原不错。</p>\r\n<p>&nbsp;</p>\r\n<p>手机背面，诺基亚为5320XM配备一颗<strong><font size=\"3\" color=\"#ff0000\">200W像素</font></strong>的摄像头，并且带有<strong><font size=\"3\" color=\"#ff0000\">两个LED的补光灯</font></strong>，可以实现拍照、摄像功能，并能通过彩信、邮件方式发送给朋友。</p>\r\n<p>&nbsp;</p>','upload/images/200905/goods_img/13_G_1241968002233.jpg','upload/images/200905/thumb_img/13_thumb_G_1241968002527.jpg',1241967762,0,''),(14,'诺基亚5800XM',0,'2625.00',1,4,1,'','upload/images/200905/goods_img/14_G_1241968492932.jpg','upload/images/200905/thumb_img/14_thumb_G_1241968492116.jpg',1241968492,0,''),(15,'摩托罗拉A810',0,'788.00',3,3,2,'','upload/images/200905/goods_img/15_G_1242973362318.jpg','upload/images/200905/thumb_img/15_thumb_G_1242973362970.jpg',1241968703,0,''),(16,'恒基伟业G101',0,'823.33',0,2,11,'','upload/images/200905/goods_img/16_G_1241968949002.jpg','upload/images/200905/thumb_img/16_thumb_G_1241968949103.jpg',1241968949,0,''),(17,'夏新N7',3,'2300.00',1123,3,5,'','upload/images/200905/goods_img/17_G_1241969394677.jpg','upload/images/200905/thumb_img/17_thumb_G_1241969394587.jpg',1241969394,0,''),(18,'夏新T5',0,'2878.00',1,4,5,'<p>&nbsp;  TD-SCDMA/GSM两种模式任意切换，中国3G手机先驱，支持大陆特有3G网络，轻松实现可视电话、视频留言、视频会议功能，2.6英寸Q屏，手写、键盘双输入，内置移动证券，支持手机邮箱、手机地图、无驱U盘</p>','upload/images/200905/goods_img/12_G_1241965978209.jpg','upload/images/200905/thumb_img/10_thumb_G_1242973436403.jpg',1241969533,0,''),(19,'三星SGH-F258',0,'858.00',12,3,6,'<p>从整体来看，三星SGH-F258比较<font size=\"3\" color=\"#ff0000\"><strong>时尚</strong></font>可爱，三围尺寸为94&times;46&times;17.5mm，重量为96克，曲线柔和具有玲珑美感。</p>\r\n<p>&nbsp;</p>\r\n<p>三星F258的前面板整体应用<strong><font size=\"3\" color=\"#ff0000\">镜面效果</font></strong>，2.0英寸显示屏幕略显窄小，导航键与功能键在滑盖滑开之前是前面板的全部控制键，没有挂断和接听键，不过，五向键有<font size=\"3\"><strong><font color=\"#ff0000\">音乐操</font><font color=\"#ff0000\">作</font></strong></font>功能，明确显示了F258音乐手机的定位。</p>\r\n<p>&nbsp;</p>\r\n<p>F258的数字键键区采用了极具金属质感的平板式设计，每颗按键的面积足够大，按键与按键之间的间隔明显，操作起来手感舒适。</p>','upload/images/200905/goods_img/19_G_1241970175091.jpg','upload/images/200905/thumb_img/19_thumb_G_1241970175208.jpg',1241970139,0,''),(20,'三星BC01',0,'280.00',12,3,6,'','upload/images/200905/goods_img/20_G_1242106490663.jpg','upload/images/200905/thumb_img/20_thumb_G_1242106490058.jpg',1241970417,0,''),(21,'金立 A30',0,'2000.00',40,3,10,'<p> </p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">标准配置: 标准锂电池两块,充电器两个,立体声耳机一个,数据线,说明书送256TF</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">通讯功能  输入法 短信功能 话机通讯录 通话记录</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">输入法: 中文输入法</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">短信功能: 支持短信300条和彩信100条</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">话机通讯录: 1000组名片式电话存储 来电防火墙功能  来电大头贴及来电铃声识别</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">通话记录：支持电话录音,恢复/静音,双音多频,免提</font></span></p>\r\n<p> </p>\r\n<p><font size=\"3\">高级功能</font></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">多媒体娱乐: 200万像素，最大支持10240*960，11级数码变焦,多种效果设置,连拍可全屏查看拍摄或下载的图片.支持有声MP4短片拍摄，录像时间根据内存 大小而定，拍摄录像,TV电视可跟朋友家人一起分享。支持网络摄像头功能 支持MPEG4、3GP(H.263)等视频格式 支持MP3等音频格式播放， 支持歌词播放</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">内置游戏:智能拼图</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">扩展存储功能:支持TF扩展,支持U盘功能,本机内置1M,随机赠送256TF卡</font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">高级功能:直板/智能PDA手写/键盘输入 超长待机 WAP上网  录音 蓝牙 FM收音机 电子书 Java扩展 TV电视输出 声控语音拨号 免费电视 来电防火墙   </font></span></p>\r\n<p align=\"left\"><span style=\"font-size: medium;\"><font size=\"3\">附加功能: 日历 计算器 闹钟 记事本 日程表 秒表 单位换算</font></span></p>\r\n<p><span style=\"font-size: medium;\"><font size=\"3\">提醒 以上性能均为本公司员工试机后所写,产品资料仅供参考,请以收到实物为准</font></span></p>','upload/images/200905/goods_img/21_G_1242109298873.jpg','upload/images/200905/thumb_img/21_thumb_G_1242109298150.jpg',1241970634,0,''),(22,'多普达Touch HD',0,'5999.00',1,3,3,'<p>